import React from "react";
import "./Main.css";
import Title from "../../components/Title";
import Navbar from '../../components/Navbar';
import Footer from '../../components/Footer';
import kate from "./images/Kate.jpg";
import kate2 from "./images/Kate2.jpg";
import kate4 from "./images/Kate4.jpg";
import kate6 from "./images/Kate6.jpg";
import kate12 from "./images/Kate12.jpg";
import kate14 from "./images/Kate14.jpg";
import kate15 from "./images/Kate15.jpg";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import Carousel from 'react-elastic-carousel';



function Main (){
  return (
    <div className="Container">


      <Navbar />


      <br/>
      <br/>
      <div className="carousel-container">

        <Carousel itemsToShow={1}>
           <Item><img src={kate}/></Item>
           <Item><img src={kate2}/></Item>
           <Item><img src={kate4} /></Item>
           <Item><img src={kate6} /></Item>
           <Item><img src={kate12} /></Item>
           <Item><img src={kate14} /></Item>
           <Item><img src={kate15} /></Item>
        </Carousel>
      </div>



              <Footer />
            </div>





)
}



export default Main;
